INSERT INTO `#__acymailing_mail`  VALUES ('1', 'New Subscriber on your website : {user:email}', '<p>Hello {subtag:name},</p><p>A new user has been created in AcyMailing : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_created', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('2', 'A User unsubscribed from all your lists : {user:email}', '<p>Hello {subtag:name},</p><p>The user {user:name} : {user:email} unsubscribed from all your lists</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_unsuball', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('3', 'A User unsubscribed : {user:email}', '<p>Hello {subtag:name},</p><p>The user {user:name} : {user:email} unsubscribed from your list</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_unsub', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('4', 'A User refuses to receive e-mails from your website : {user:email}', '<p>The User {user:name} : {user:email} refuses to receive any e-mail anymore from your website.</p><p>Subscription : {user:subscription}</p><p>{survey}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_refuse', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('5', '{subtag:name|ucfirst}, {trans:PLEASE_CONFIRM_SUB}', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n			<table style=\"text-align:justify; margin:auto; background-color:#ebebeb; border:1px solid #e7e7e7\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"600\" align=\"center\" bgcolor=\"#ebebeb\">\r\n			<tbody>\r\n			<tr style=\"line-height: 0px;\">\r\n			<td style=\"line-height: 0px;\" height=\"38px\"><img src=\"media/com_acymailing/templates/newsletter-4/top.png\" border=\"0\" alt=\" - - - \" /></td>\r\n			</tr>\r\n			<tr>\r\n			<td style=\"text-align:center\" width=\"600\">\r\n			<table style=\"margin:auto;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"520\">\r\n			<tbody>\r\n			<tr>\r\n			<td style=\"background-color: #ffffff; border: 1px solid #dbdbdb; padding: 20px; width: 500px; margin: 15px auto; text-align: left;\">\r\n			<h1>Hello {subtag:name|ucfirst},</h1>\r\n			<p>{trans:CONFIRM_MSG}<br /><br />{trans:CONFIRM_MSG_ACTIVATE}</p>\r\n			<br />\r\n			<p style=\"text-align:center;\"><strong>{confirm}{trans:CONFIRM_SUBSCRIPTION}{/confirm}</strong></p>\r\n			</td>\r\n			</tr>\r\n			</tbody>\r\n			</table>\r\n			</td>\r\n			</tr>\r\n			<tr style=\"line-height: 0px;\">\r\n			<td style=\"line-height: 0px;\" height=\"40px\"><img src=\"media/com_acymailing/templates/newsletter-4/bottom.png\" border=\"0\" alt=\" - - - \" /></td>\r\n			</tr>\r\n			</tbody>\r\n			</table>\r\n			</div>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'confirmation', NULL, '1', '1', NULL, NULL, 'a:3:{s:6:\"action\";s:7:\"confirm\";s:13:\"actionbtntext\";s:28:\"{trans:CONFIRM_SUBSCRIPTION}\";s:9:\"actionurl\";s:19:\"{confirm}{/confirm}\";}', NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('6', 'AcyMailing Cron Report {mainreport}', '<p>{report}</p><p>{detailreport}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'report', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('7', 'A Newsletter has been generated : \"{subject}\"', '<p>The Newsletter issue {issuenb} has been generated : </p><p>Subject : {subject}</p><p>{body}</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_autonews', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('8', 'Modify your subscription', '<p>Hello {subtag:name}, </p><p>You requested some changes on your subscription,</p><p>Please {modify}click here{/modify} to be identified as the owner of this account and then modify your subscription.</p>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'modif', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('9', 'Új szavazás legyen FNA?', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}This email contains graphics, so if you don\'t see them, view it in your browser{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n<td class=\"acyeditor_text w520\" style=\"text-align: left; background-color: #ebebeb;\" colspan=\"3\" width=\"520\" height=\"80\"><img style=\"float: left; margin-right: 10px;\" src=\"media/com_acymailing/templates/newsletter-4/images/message_icon.png\" alt=\"-\" />\r\n<h3>Legyen FNA (szerű) juttatás?</h3>\r\n<h4>&nbsp;</h4>\r\n</td>\r\n<td class=\"acyeditor_picture w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"