\"w40\" style=\"background-color: #ebebeb;\" width=\"40\">&nbsp;</td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz több ilyen levelet kapni? {unsubscribe}Leiratkozás{/unsubscribe}</div>\r\n</div>', '', '1', '1417080576', '1415791006', '', '', '', '', 'news', '1', '66', 'uj-szavazas-legyen-fna', NULL, '1', '1', 'bfd9e773932f1a4102e1ebfcd1274d54', NULL, NULL, '66', '', '', NULL, '', NULL, NULL, '', NULL), ('10', 'New contact from your website : {user:email}', '<p>Hello {subtag:name},</p><p>A user submitted the form : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_contact', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('11', 'A user subscribed or modified his subscription : {user:email}', '<p>Hello {subtag:name},</p><p>A user submitted the form : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_contact_menu', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('12', 'A user confirmed his subscription : {user:email}', '<p>Hello {subtag:name},</p><p>A user confirmed his subscription : </p><blockquote><p>Name : {user:name}</p><p>Email : {user:email}</p><p>IP : {user:ip} </p><p>Subscription : {user:subscription}</p></blockquote>', '', '1', NULL, NULL, NULL, NULL, NULL, NULL, 'notification', '0', NULL, 'notification_confirm', NULL, '1', '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', NULL, NULL, '', NULL), ('13', 'EDE projekt', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}This email contains graphics, so if you don\'t see them, view it in your browser{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"acyeditor_text w520\" style=\"text-align: left; background-color: #ebebeb;\" colspan=\"3\" width=\"520\" height=\"80\"><img style=\"float: left; margin-right: 10px;\" src=\"media/com_acymailing/templates/newsletter-4/images/message_icon.png\" alt=\"-\" />\r\n<h3>Topic of your message</h3>\r\n<h4>Subtitle for your message</h4>\r\n</td>\r\n<td class=\"acyeditor_picture w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"acyeditor_text w480 pict\" style=\"background-color: #fff; text-align: left;\" width=\"480\">\r\n<h1>Kedves bBartárom {subtag:name},</h1>\r\n<p style=\"text-align: right;\"><button type=\"button\"><strong>X</strong></button></p>\r\n<p>Az \"Informatikusok az E demokráciárt\" csoport mintegy 4-5 fő \"erős informatikus\" részvételével.  Ez a csoport más uton kivánja az e-demokráciát megoldani, nevezetesen a AIRESIS szoftverre támaszkodva.</p>\r\n<p><a href=\"http://airesis.eu\" style=\"font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px;\">http://airesis.eu</a></p>\r\n<p><a href=\"https://www.facebook.com/edemomakers\">https://www.facebook.com/edemomakers</a>  <a href=\"https://www.facebook.com/edemomakers\"></a></p>\r\n<p><span id=\"docs-internal-guid-28a2bb59-fdbc-9fa3-4e98-03e4e3cb4ef4\" style=\"line-height: 18px;\"><span style=\"font-size: 32px; font-family: Arial; color: #ffffff; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">Airesis: </span></span><span id=\"docs-internal-guid-28a2bb59-fdbc-9fa3-4e98-03e4e3cb4ef4\" style=\"line-height: 18px;\"><span style=\"font-size: 32px; font-family: Arial; color: #ffffff; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\"> (</span><span style=\"font-size: 24px; font-family: Arial; color: #ffffff; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">RubyOnRails, pgSQL</span><span style=\"font-size: 32px; font-family: Arial; color: #ffffff; vertical-align: baseline; white-space: pre-wrap; background-color: transparent;\">)</span></span></p>\r\n<p>Ez a szoftver NEM LIKVID DEMOKRÁCIA hanem KÖZVETLEN DEMOKRÁCIA megvalósítás.</p>\r\n<p>Fő jellemzői:</p>\r\n<p>- integrált fórum</p>\r\n<p>- integrált dokumentáció tár</p>\r\n<p>- integrált naptár</p>\r\n<p>- csoportok hozhatóak létre (egyenlőre úgy látom egy szintű, de tovább lesz fejlesztve strukturálra)</p>\r\n<p>- preferenciális szavazás Condorcet kiértékeléssel</p>\r\n<p> </p>\r\n<p>Az ezzel kapcsolatos viszonyunkról kiirtam egy szavazást, kérlek nézzétek meg, kommenteljetek, javasoljatok alternativákat majd amikor ennek eljön az ideje szavazzatok!</p>\r\n<p><a href=\"index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=37&amp;szavazas=45\">http://li-de.tk/index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=37&amp;szavazas=45</a></p>\r\n<p> </p>\r\n</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz több ilyen levelet kapni? {unsubscribe}Leiratkozás{/unsubscribe}</div>\r\n</div>', '', '1', '1421596805', '1421596464', '', '', '', '', 'news', '1', '66', 'ede-projekt', NULL, '1', '1', '7JyVwBIf', NULL, NULL, '66', '', '', NULL, '', NULL, NULL, '', NULL), ('14', 'Itt a lehetőség, hogy megismerjük az ELŐVÁLASZTÁS szerepét.', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}Ez a levél a NET -ről elért grafikai elemeket tartalmaz{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"acyeditor_text w520\" style=\"text-align: left; background-color: #ebebeb;\" colspan=\"3\" width=\"520\" height=\"80\"><img style=\"float: left; margin-right: 10px;\" src=\"media/com_acymailing/templates/newsletter-4/images/message_icon.png\" alt=\"-\" />\r\n<h3>Topic of your message</h3>\r\n<h4>Subtitle for your message</h4>\r\n</td>\r\n<td class=\"acyeditor_picture w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"acyeditor_text w480 pict\" style=\"background-color: #fff; text-align: left;\" width=\"480\">\r\n<h1>Kedves Barátom {subtag:name}!</h1>\r\n<p style=\"margin-bottom: 0px; white-space: pre-wrap; color: #141823; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; line-height: 17.9400005340576px;\"><span style=\"line-height: 17.9400005340576px;\">Itt a lehetőség, hogy megismerjük az ELŐVÁLASZTÁS szerepét. A veszprémi időközi választás kapcsán szavazást indítunk, azaz egy előválasztást tartunk, hogy melyik induló jelölt kapná a legtöbb voksot. A szavazás lezárultával megküldjük neketek az elemzést, melyből majd láthatjátok az előválasztás jelentősségét.</span></p>\r\n<p style=\"margin-top: 10px; margin-bottom: 0px; white-space: pre-wrap; color: #141823; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; line-height: 17.9400005340576px;\">A kísérletünk érdekében a jelöltek listáját kiegészítettük 3 olyan (természetesen fiktív) jelölttel, akiknek programja csupán annyi, hogy beviszik a parlamentbe a választók véleményét, álláspontját, azaz azt vállalják, hogy általunk \"távvezérelve\" képviselnek minket az országházban. Hangsúlyozzuk, ez most csak egy kísérlet, egy majdani valós előválasztás szimulációja, tekinthetjük játéknak is, de megvilágíthatja számunkra, mit érhetünk el vele.</p>\r\n<p style=\"margin-top: 10px; margin-bottom: 0px; white-space: pre-wrap; color: #141823; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; line-height: 17.9400005340576px;\">Az alternatív javaslattétel útján még 1 hétig lehetőség van önkéntjelentkezők listára kerülésére közülünk.</p>\r\n<p style=\"margin-top: 10px; margin-bottom: 0px; white-space: pre-wrap; color: #141823; font-family: Helvetica, Arial, \'lucida grande\', tahoma, verdana, arial, sans-serif; line-height: 17.9400005340576px;\">A minél valóságosabb eredmény érdekében, kérjük, hogy minél több jelöltre szavazzatok szimpátia-sorrendben.</p>\r\n</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz több ilyen levelet kapni? {unsubscribe}Leiratkozás{/unsubscribe}</div>\r\n</div>', '', '1', NULL, '1422033078', '', '', '', '', 'news', '1', '66', 'itt-a-lehetoseg-hogy-megismerjuk-az-elovalasztas-szerepet', NULL, '1', '1', 'K4xwC048', NULL, NULL, NULL, '', '', NULL, '', NULL, NULL, '', NULL), ('15', 'Fejlesztések a li-de programban', '<div style=\"text-align: center; width: 100%; background-color: #ffffff;\">\r\n<div class=\"acymailing_online acyeditor_delete acyeditor_text\" style=\"text-align: center;\">{readonline}Ez a levél a NET -ről elért grafikai elemeket tartalmaz{/readonline}</div>\r\n<table class=\"w600\" style=\"text-align: justify; margin: auto; width: 600px;\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #69b4c0;\" colspan=\"5\" valign=\"bottom\" width=\"600\"><img class=\"w600\" src=\"images/banners/social-media_680x100l.png\" alt=\"social-media 680x100l\" /></td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\