<li>Lehetőség van az egymáshoz nagyon hasonló szavazások Vágolapra másolással/beillesztéssel történi indítására (pl. folyamatos, ismétlödő szavazások)</li>\r\n</ul>\r\n<p>Kérlek benneteket kommentezzetek, fórumozzatok elsősorban az aktuális témában (EDE rendszer beindulásávalkapcsolatos teendők):</p>\r\n<p><a href=\"index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=37&amp;szavazas=45\">http://li-de.tk/index.php?option=com_alternativak&amp;view=alternativaklist&amp;task=browse&amp;limit=20&amp;limitstart=0&amp;filterStr=&amp;order=1&amp;temakor=37&amp;szavazas=45</a></p>\r\n<p> </p>\r\n<p>(de persze bármi más témában is amiben mondanivalótok van)</p>\r\n<p> </p>\r\n<p>Kérlek indítsatok új témákat, szavazásokat, ajánljátok a rendszert ismerőseiteknek, egyesületeknek, kluboknak, csoportoknak!</p>\r\n<p> </p>\r\n<p style=\"text-align: right;\"><strong><em>Utopszkij</em></strong></p>\r\n<p> </p>\r\n</td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w480\" style=\"background-color: #fff;\" width=\"480\" height=\"20\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\" style=\"line-height: 0px;\">\r\n<td class=\"w600\" style=\"background-color: #ebebeb;\" colspan=\"5\" width=\"600\"><img class=\"w600\" src=\"media/com_acymailing/templates/newsletter-4/images/bottom.png\" alt=\" - - - \" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div class=\"acyeditor_delete acyeditor_text\" style=\"text-align: center;\">Nem akarsz t