th=\"40\"> </td>\r\n</tr>\r\n<tr class=\"acyeditor_delete\">\r\n<td class=\"w40\" style=\"background-color: #ebebeb;\" width=\"40\"> </td>\r\n<td class=\"w20\" style=\"background-color: #fff;\" width=\"20\"> </td>\r\n<td class=\"acyeditor_text w480 pict\" style=\"background-color: #fff; text-align: left;\" width=\"480\">\r\n<h1>Kedves Barátom {subtag:name}!</h1>\r\n<p><img style=\"margin: 5px; float: right;\" src=\"http://azigazsag.hu/az-igazsag-kepekben/-politika.jpg\" alt=\"\" width=\"300\" /><a></a></p>\r\n<p style=\"margin-bottom: 0.5cm;\">Mint bizonyára tudod hamarosan időközi országgyűlési választás lesz Veszprémben.</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Ezt az eseményt nagy érdeklődés kíséri, ugyanis megdőlhet a FIDESZ kétharmada, illetve meglátjuk a kormány népszerűség vesztése hogyan tükröződik a szavazatokban.</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Javaslom, hogy ezzel kapcsolatban rendezzünk egy - félig komoly - internetes előválasztást!</p>\r\n<p style=\"margin-bottom: 0.5cm;\">A levél alján látható linkkel elérhető li-de.tk szavazáson adjátok le a szavazatotokat, ti melyik jelölteket támogatjátok? Ne csak az adott választási körzetbe tartozók szavazzanak!</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Érdekes lesz  ennek az internetes közvélemény kutatásnak és a tényleges szavazási eredmények az összehasonlítása.</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Ez a szavazás preferenciális (Borda) rendszerű, Concordet elv szerinti kiértékeléssel, szemben a tényleges választás primitív \"egy jelöltet támogathatok\" rendszerével. Itt kifejezhetem több jelölttel kapcsolatos szimpátiámat, ellenszenvemet, úgy hogy a jelölteket szimpátia sorrendbe állítom, több jelöltet is rangsorolhatok azonos pozícióba.</p>\r\n<p style=\"margin-bottom: 0.5cm;\">Tehát ez az \"előválasztás\" egyúttal ennek a szavazási módszernek a használhatóságára is példa lesz.</p>\r\n<p style=\"margin-bottom: 0.5cm;\"><strong>Kérlek benneteket szavazzatok!</strong></p>\r\n<p style=\"margin-bott